import React from "react";

function App() {
  const [dados, setDados] = React.useState(null);

  React.useEffect(() => {
    fetch("https://ranekapi.origamid.dev/json/api/produto/notebook")
      .then((response) => response.json())
      .then((json) => setDados(json));
  }, []);

  return (
    <div>
      <div>
        {dados && (
          <div>
            <h1>{dados.nome}</h1>
          </div>
        )}
      </div>
    </div>
  );
}

export default App;
